import React from 'react'
import { Ellipsis } from 'react-bootstrap/esm/PageItem'

const ImgTest = ({el}) => {
    return (
       <>
              <div className="card">
                <div className="card-header1">
                    <h3>{el.title}</h3>
                    <p>{el.par}</p>
                  <img 
                    src={el.img}
                    alt={el.title}
                  />
            </div>
        </div>
      </>
    )
}

export default ImgTest
